const Input = (props) => {


    const callInput=()=>{

        InputEvent();

    }

    return (
        <>
            <div className="mb-3">
                <label for="exampleFormControlInput1" className="form-label">{props.fname}</label>
                <input type="text" className="form-control" id="exampleFormControlInput1" placeholder={props.pholder}
                    name="fullname"
                    value={props.value}
                    onChange={callInput}
                />
            </div>
        </>

    )
}

export default Input;
